snippet.description:
A Escola Superior do Ministério Público da União (ESMPU) realizou, no dia 3 de setembro, o Seminário virtual "O Ministério Público e o direito ao tratamento precoce: limites e possibilidades".

Debatedores:
Paulo Gustavo Gonet Branco: Diretor-Geral da ESMPU
Rinaldo Reis Lima: Corregedor Nacional do Ministério Público;
Fabiano Dallazen: Presidente do Conselho Nacional de Procuradores-Gerais do Ministério Público (CNPG);
Eduardo Pazuello: Ministro Interino da Saúde;
Antonio Kalil: Diretor Médico e de Ensino e Pesquisa da Santa Casa de Misericórdia de Porto Alegre;
Francisco Cardoso: Médico infectologista;
Wellington Cabral Saraiva: Procurador Regional da República; e
Ailton Benedito: Procurador da República.

